        whatsapp: "",
        facebook: "",
        youtube: "",
        instagram: "",
        email: "",
        LojaUm: "",
        horarioFuncionamentoUm: "",
        localUm: "",
        cepUm: "",
        telefoneUm: "",
        LojaDois: "",
        horarioFuncionamentoDois: "",
        localDois: "",
        cepDois: "",
        telefoneDois: "",
        LojaTres: "",
        horarioFuncionamentoTres: "",
        localTres: "",
